style.css:
@-moz-document domain("algumon.com") {
.opinion-box {
        visibility: hidden;
    }

    .deal-meta-info {
        visibility: hidden;
    }

    p:nth-child(3) {
        visibility: hidden;
    }

    .deal-hashtags {
        visibility: hidden;
    }

    span.dot.red {
        visibility: hidden;
    }

    .product-link {
        font-size: 30px;
    }

    .product-price {
        font-size: 30px;
    }

    .product-per-price {
        font-size: 30px;
    }

    .deal-header-p a {
        font-size: 30px;
    }

    .post-group .label-time {
        font-size: 30px;
        align-content: start;
    }

    .post-group .site {
        font-size: 30px;
    }

    .product-img.pull-left {
        font-size: 30px;
    }

    .product-img .product-img-box {
        width: 150px;
        height: 150px;
    }

    .product li.left .product-body {
        margin-left: 170px;
    }

    .post-list li.post-li {
        height: 170px;
    }
}
